import React, { useState ,useRef} from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonInput, IonItem, IonLabel, IonList, IonItemDivider, IonGrid, IonRow, IonCol } from '@ionic/react';

const Formedit: React.FC = () => {

  const [text, setText] = useState<string>();
  const [number, setNumber] = useState<number>();

  const weighinputRef=useRef<HTMLIonInputElement>(null);
  const nameref=useRef<HTMLIonInputElement>(null);

  return (
    <IonPage>
      <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Register</IonTitle>
          </IonToolbar>
        </IonHeader>
      <IonContent className="ion-padding">
      <IonGrid>
          <IonRow>
              <IonCol>
              <IonItem>
              <IonLabel position="floating">Full Name</IonLabel>
              <IonInput type ref={nameref}></IonInput>
            </IonItem>
              </IonCol>
          </IonRow>
     
            
            

          <IonItemDivider>Contact No</IonItemDivider>
          <IonItem>
            <IonInput type="number" value={number} placeholder="Enter Number" onIonChange={e => setNumber(parseInt(e.detail.value!, 10))}></IonInput>
          </IonItem>

         

          
          </IonGrid>
      </IonContent>
    </IonPage>
  );
};
export default Formedit;
